import React from 'react';
import Navigation from '../components/Navigation';
import BoutonSupprimerServices from '../components/BoutonSupprimerServices';
import BoutonFermeOuvert from '../components/BoutonFermeOuvert';
import BoutonCreerEmploye from '../components/BoutonCreerEmploye';
import BoutonSupprimerEmploye from '../components/BoutonSupprimerEmploye';
import { useState } from 'react';
import AjoutServices from '../components/AjoutServices';

const DashboardAdmin = () => {

    const [isOpenAjout, setIsOpenAjout] = useState(false);

    const isOpenAjouter = () => {
        setIsOpenAjout(true);
    }

    const isCloseAjouter = () => {
        setIsOpenAjout(false);
    }

    return (
        <div>
            <Navigation />
            <h1>Espace administration admin</h1>
            <div className="boutonDashboard">
                {isOpenAjout === false ?
                    <button onClick={isOpenAjouter}>Ajouter un service</button>
                    :
                    <button onClick={isCloseAjouter}>Annuler</button>
                }
            </div>

            {isOpenAjout === false ?
                null
                :
                <AjoutServices />
            }

        </div>
    );
};

export default DashboardAdmin;
